const stateInit = [];

const sannefaReducer = (state = stateInit, action) => {

  if (action.type === "GET_Platjour") {
    return action.payload; } 




                       else if (action.type === "ADD_Platjour") {
                                             return [...state, action.payload]; } 


  else {
    return state;
  }
};

